    "rachel-carson-national-wildlife-refuge-annual-narrative-report-calendar-year-1979",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Rachel
    Carson NWR outlines Refuge accomplishments during the 1979 calendar year. The report
    begins with an introduction to the Refuge and information about weather conditions,
    habitat conditions, land acquisition activities, and the system status. Construction
    and maintenance are also described. Habitat management is covered; grasslands, wetlands,
    and forests are discussed. The wildlife section of the report discusses endangered
    and threatened species, migratory birds, mammals, and non-migratory birds. Interpretation
    and recreation activities are outlined; topics include information and interpretation,
    recreation, and law enforcement. Cooperative programs, items of interest, and safety
    information are attached.",nt"license_title": "License Not Specified",nt"extras":
